import React, { useEffect } from "react";
import "./UserPage.css";
import ProductTableBody from "./ProductTableBody/ProductTableBody";
import axios from "../../utils/axios";
function UserPage() {
  const data={
    name:"olmalar",
    prise:"1500"
  }
  useEffect(()=>{
    const fetching = async ()=>{
        try {
            const {data}= axios.get('/users/profile')
            console.log(data);
        } catch (err) {
            console.log(err);
        }
    }
    fetching 
  })
    return (
        <main className="user-container">
            <div className="usertable">
                <table className="table table-hover  table-striped  mx-5 table-warning">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Name</th>
                            <th scope="col">Prise</th>

                            <th scope="col">Edit</th>
                        </tr>
                    </thead>
                    <tbody>
                      <ProductTableBody data={data} index={1} />
                      <ProductTableBody data={data} index={1} />
                      <ProductTableBody data={data} index={1} />
                      <ProductTableBody data={data} index={1} />
                      <ProductTableBody data={data} index={1} />
                      <ProductTableBody data={data} index={1} />
                    </tbody>
                </table>
            </div>
        </main>
    );
}

export default UserPage;
